// DetailsPage.js
import React from 'react';
import { useParams } from 'react-router-dom';
import { hospitalData } from './data';

const DetailsPage = () => {
  const { hospitalId } = useParams();
  const hospital = hospitalData.find(h => h.id === parseInt(hospitalId));

  if (!hospital) {
    return <h1>Hospital not found</h1>;
  }

  return (
    <div className="details-page">
      <h1>{hospital.name}</h1>
      <img src={hospital.image} alt={hospital.name} className="hospital-image" />
      <p>{hospital.address}</p>
      <h2>Doctors</h2>
      <div className="doctor-list">
        {hospital.doctors.map(doctor => (
          <div key={doctor.id} className="doctor-card">
            <img src={doctor.image} alt={doctor.name} className="doctor-image" />
            <h3>{doctor.name}</h3>
            <p>{doctor.profession}</p>
            <p>Experience: {doctor.experience}</p>
            <p>Contact: {doctor.mobile}</p>
            <p>{doctor.intro}</p>
            <button>Book Appointment</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DetailsPage;
